import React, { Component } from 'react';
import { StyleSheet, Text, View, Linking } from 'react-native';

class Header extends Component {
  render(){
    return (
        <View>
            <View style={styles.header}>
            <Text>Header content</Text>
            <View style={styles.headerlinks}>
                <Text style={styles.links} onPress={() => Linking.openURL('http://google.com')}>one</Text>
                <Text style={styles.links}>two</Text>
                <Text style={styles.links}>Three</Text>
            </View>
            </View>
        </View>
    );
  }

}

const styles = StyleSheet.create({
  header: {
    width: "100%",
    height: "15%",
    alignItems: "center",
    justifyContent: "center",
    backgroundColor: "#eee"
  },
  headerlinks: {
    flexDirection:'row',
    flexWrap:'wrap',
    // padding: "10"
    // margin: "10 px"
  },
  links: {
    //   marginTop: 10,
    padding: 10
  }
});

export default Header;
